@ijeamaka_a @geokaramanis If in Mac or Linux terminal this will copy all the hexcodes from your R and Rmd scripts into a new text file, which you can then import into R and count:

grep -Eroh --include="*.Rmd" --include="*.R" "\"#[a-zA-Z0-9]{6}\"" . | sort | sed 's/"//g' &gt; my_colors.txt

